import './Nav.css';
import {Link} from 'react-router-dom';
import { useState, useEffect } from 'react';
function Nav()
{

    const [NavContent, setNavContent]=useState();
    useEffect(()=>{
            if(localStorage.getItem("token")!=undefined && localStorage.getItem("role")=="admin")
            {
                setNavContent(
                    <>
                     {/* Navbar Start */}
    <div class="container-fluid p-0">
        <nav class="navbar navbar-expand-lg bg-dark navbar-dark py-3 py-lg-0 px-lg-5">
            <a  class="navbar-brand d-block d-lg-none">
                <h1 class="m-0 display-5 text-capitalize font-italic text-white"><span class="text-primary">Safety</span>First</h1>
            </a>
            <button type="button" class="navbar-toggler" data-toggle="collapse" data-target="#navbarCollapse">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse justify-content-between px-3" id="navbarCollapse">
                <div class="navbar-nav mr-auto py-0">
                    <a  class="nav-item nav-link active" ><Link to="/admin" style={{"color":"#f8f7f5"}}> Admin Home</Link></a>
                </div>
                <a class="btn btn-lg btn-primary px-3 d-none d-lg-block"><Link to="/login" style={{"color":"#f8f7f5"}}>Log Out</Link></a>
            </div>
        </nav>
    </div>
    {/* Navbar End */}

                    </>
                );
            }
            else if(localStorage.getItem("token")==undefined &&localStorage.getItem("role")=="user")
            {
                setNavContent(
                    <>
                     {/* Navbar Start */}
    <div class="container-fluid p-0">
        <nav class="navbar navbar-expand-lg bg-dark navbar-dark py-3 py-lg-0 px-lg-5">
            <a  class="navbar-brand d-block d-lg-none">
                <h1 class="m-0 display-5 text-capitalize font-italic text-white"><span class="text-primary">Safety</span>First</h1>
            </a>
            <button type="button" class="navbar-toggler" data-toggle="collapse" data-target="#navbarCollapse">
                <span class="navbar-toggler-icon"></span>
            </button>
            <div class="collapse navbar-collapse justify-content-between px-3" id="navbarCollapse">
                <div class="navbar-nav mr-auto py-0">
                    <a  class="nav-item nav-link active" ><Link to="/admin" style={{"color":"#f8f7f5"}}> User Home</Link></a>
                </div>
                <a class="btn btn-lg btn-primary px-3 d-none d-lg-block"><Link to="/login" style={{"color":"#f8f7f5"}}>Log Out</Link></a>
            </div>
        </nav>
    </div>
    {/* Navbar End */}

                    </>
                );
            }
            else
            {
                 {/* Navbar Start */}
    <div class="container-fluid p-0">
    <nav class="navbar navbar-expand-lg bg-dark navbar-dark py-3 py-lg-0 px-lg-5">
        <a  class="navbar-brand d-block d-lg-none">
            <h1 class="m-0 display-5 text-capitalize font-italic text-white"><span class="text-primary">Safety</span>First</h1>
        </a>
        <button type="button" class="navbar-toggler" data-toggle="collapse" data-target="#navbarCollapse">
            <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse justify-content-between px-3" id="navbarCollapse">
            <div class="navbar-nav mr-auto py-0">
                <a  class="nav-item nav-link active" ><Link to="/" style={{"color":"#f8f7f5"}}> Home</Link></a>
                <a class="nav-item nav-link"><Link to="/about" style={{"color":"#f8f7f5"}}>About us</Link></a>
                <a class="nav-item nav-link"><Link to="/service" style={{"color":"#f8f7f5"}}>Service</Link></a>
                <a class="nav-item nav-link"><Link to="/register" style={{"color":"#f8f7f5"}}>Register</Link></a>
                {/* <a href="" class="nav-item nav-link"></a> */}
                <div class="nav-item dropdown">
                    <a href="#" class="nav-link dropdown-toggle" data-toggle="dropdown">Pages</a>
                    <div class="dropdown-menu rounded-0 m-0">
                        <a href="" class="dropdown-item">Blog Grid</a>
                        <a href="" class="dropdown-item">Testimonial</a>
                    </div>
                </div>
                <a class="nav-item nav-link"><Link to="/contact" style={{"color":"#f8f7f5"}}>Contact</Link></a>
            </div>
            <a class="btn btn-lg btn-primary px-3 d-none d-lg-block"><Link to="/login" style={{"color":"#f8f7f5"}}>Log In</Link></a>
        </div>
    </nav>
</div>
{/* Navbar End */}


